(630, 41, 1, 'Trousers2|Red|Shipping|No|Ralph Lauren|M|FIONA ALL OVER QUILTED TROUSERS|Trousers are a more sophisticated alternative to skinnies Trousers take on a relaxed silhouette for the new season, with sports tailoring setting the trends and the wide leg one to watch. Pick printed palazzo pants for a dramatic day time look and tone down with a basic tee, or go for androgynous appeal in tapered man pants and wear with worn-in trainers for a trend-led twist.|Trousers are a more sophisticated alternative to skinnies Trousers take on a relaxed silhouette for the new season, with sports tailoring setting the trends and the wide leg one to watch. Pick printed palazzo pants for a dramatic day time look and tone down with a basic tee, or go for androgynous appeal in tapered man pants and wear with worn-in trainers for a trend-led twist.|15.99|1'),
