(155, 4, 72, 0, 27, '70% Cotton, 27% Polyester, 3% Elastane. Total Length 113.5cm/44.75", Inside Leg Length 81cm/32", Waist 43cm/17", Thigh 25cm/10", Hem Width 18cm/7". (Measured from UK Size 32R). Machine Washable. Model Wears UK Size 32R.'),
(156, 4, 73, 0, 27, 'Jeans are a guy’s best friend\r\n\r\nJeans are always there to save the day. What’s not to love? Easy to wear and stylish at the same time. Whether you’re a slim, skinny or straight fit kinda guy, jeans can suit every style. From indigo and lightwash to staple black jeans, make sure you add some new denim to your AW wardrobe.Throw on a hoody and a cool pair of trainers and you’re good to go.'),
(157, 4, 83, 0, 27, NULL),
(158, 4, 106, 0, 27, NULL),
(159, 4, 72, 0, 28, '99% Cotton, 1% Elastane. Total Leg Length: 104cm/40.75, Inside Leg Length: 76cm/29.75, Waist: 42cm/16.5, Hem Width: 16cm/6.25. Machine Washable. Model Wears Size 32R'),
(160, 4, 73, 0, 28, 'Tailored or trend-led, jeans are a faithful fashion favourite\r\n\r\nJust jeans - it’s as simple as that! Slim, skinny or straight, acid wash or basic blue, denim is definitely men’s most-worn wardrobe item. This season denim goes dark – think deep indigo dyes for an instant update to your look. Dress them up in a blazer and brogues, or go for effortlessly edgy in a basic tee and plimsolls. Work and rework!'),
(161, 4, 83, 0, 28, NULL),
(162, 4, 106, 0, 28, NULL),
(163, 4, 72, 0, 29, '99% Cotton, 1% Elastane. Total Leg Length: 104cm/40.75, Inside Leg Length: 76cm/29.75, Waist: 42cm/16.5, Hem Width: 16cm/6.25. Machine Washable. Model Wears Size 32R'),
(164, 4, 73, 0, 29, 'Jeans are a failsafe fashion favourite\r\n\r\nJust jeans - it’s as simple as that! Slim, skinny or straight, acid wash or basic blue, denim is definitely the most-worn wardrobe item. This season denim goes dark – think deep indigo dyes for an instant update to your look. Dress them up in a blazer and brogues, or look effortlessly edgy in a basic tee and desert boots. Work and rework these jeanius bottoms!'),
(165, 4, 83, 0, 29, NULL),
(166, 4, 106, 0, 29, NULL),
(167, 4, 72, 0, 30, '*Cotton\r\n*Runs true to size\r\n*Model is wearing smallest size available\r\n*Machine wash cold\r\n*Made in USA\r\n\r\nIf you''re not utterly obsessed with your recent purchase, it''s now so easy to send it back! All US returns can be completed online using our fast, hassle-free system. Check out the links below for more details.\r\n  +  US Returns\r\n  +  International Returns\r\n\r\n'),
(168, 4, 73, 0, 30, 'You''re officially invited to Nasty Gal''s After Party. Each piece is made with reworked vintage fabric, so take your pick of these limited edition styles and give them a second chance to party. This navy dress has ribbed detailing, a mock neck, and stretch fabric. Wear it with sneakers and your go-to denim jacket.'),
(169, 4, 83, 0, 30, NULL),
