(197, 4, 72, 0, 35, 'A faithful pair of leggings are essential for every wardrobe\r\n\r\nThey’re comfortable, stretchy and fun - A girl’s wardrobe should never be without a pair of staple leggings! Whether you’re lounging around or layering up, you’ll find a pair to suit your style. From animal prints and wet look finishes, to classic jersey and high shine disco pants, leggings are a girl’s best friend. Step into your best boots and keep it casual with a cami top.\r\n'),
