(231, 4, 72, 0, 40, 'Grid print tapered trousers\r\n\r\nMake a point in monochrome with these pin-perfecting printed trousers. Style with a high neck crop top, Perspex heels and a slogan clutch.\r\n\r\nMelanie is 5''8" and wears UK size 10\r\n\r\nMade from an easy-care, poly-blend fabric\r\nStretch added for comfort\r\nFlattering high rise\r\nTwin hip pockets\r\nTapered leg\r\nSkinny fit'),
(232, 4, 73, 0, 40, 'Grid print tapered trousers\r\n\r\nMake a point in monochrome with these pin-perfecting printed trousers. Style with a high neck crop top, Perspex heels and a slogan clutch.\r\n\r\nMelanie is 5''8" and wears UK size 10\r\n\r\nMade from an easy-care, poly-blend fabric\r\nStretch added for comfort\r\nFlattering high rise\r\nTwin hip pockets\r\nTapered leg\r\nSkinny fit'),
