(243, 4, 72, 0, 41, 'Trousers are a more sophisticated alternative to skinnies\r\n\r\nTrousers take on a relaxed silhouette for the new season, with sports tailoring setting the trends and the wide leg one to watch. Pick printed palazzo pants for a dramatic day time look and tone down with a basic tee, or go for androgynous appeal in tapered man pants and wear with worn-in trainers for a trend-led twist.'),
(244, 4, 73, 0, 41, 'Trousers are a more sophisticated alternative to skinnies\r\n\r\nTrousers take on a relaxed silhouette for the new season, with sports tailoring setting the trends and the wide leg one to watch. Pick printed palazzo pants for a dramatic day time look and tone down with a basic tee, or go for androgynous appeal in tapered man pants and wear with worn-in trainers for a trend-led twist.'),
