(247, 4, 72, 0, 42, 'T-shirts and vests are the power players in every man’s wardrobe\r\n\r\nThis season the dream team in male dressing gets daring with t-shirts and vests taking on poppin’ paisley prints and sporty slogans to keep you enviably on-trend. Vests come in versatile block colours for building your perfect look and polos in polished prints, while back to nature animal motifs are the new trend to try. Pair your printed tee with skinny jeans and suede desert boots to take you from day to night in style.'),
