(273, 4, 72, 0, 48, 'We couldn''t be more excited about Death in Paris-- a design team whose emphasis on the everyday is modern and effortless every time. The Véranda Crossbody is made in transparent plexiglass. It features gold hardware, gold chain and black leather shoulder strap, and flap-and-lock closure. Includes seperate leather and plastic zip pouch with silver Death in Paris stamp. Shoulder strap is removable and features "padlock" hooks. Perfect with anything from a chunky sweater and leather mini to jeans and a tunic.\r\n\r\n*Leather/Synthetic \r\n*8"/20cm height \r\n*11"/28cm width \r\n*Made in U.S.A'),
