(293, 4, 72, 0, 53, 'Ships from and sold by Amazon.com. Gift-wrap available.\r\nWant it Thursday, Nov. 6? Order within 21 hrs 16 mins and choose One-Day Shipping at checkout. Details\r\nThe epitome of contemporary style, this Movado watch features a calfskin leather strap and a minimalist blue dial, punctuated by a single mark at the 12 o''clock position.\r\nSwiss Quartz movement with analog display\r\nProtective synthetic sapphire dial window\r\nStainless steel case and bezel, leather calfskin band, buckle clasp\r\nWater resistant to 99 feet (30 M): withstands rain and splashes of water, but not showering or submersion'),
