(301, 4, 72, 0, 55, 'Get dance floor-ready in an entrance-making evening dress\r\n\r\nLook knock-out on nights out in figure-skimming bodycon fits, flowing maxi lengths and stunning sequin-embellished occasion dresses. This season make for satin sheen slip dresses in mink nudes, and match lace trim cami dresses with barely-there heels for that cocktail-ready combo. If glitterball gowns aren''t your thing, take to the dance floor in a tux dress for an all-eyes-on-you androgynous look.'),
