INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-10-06 14:05:48', '2014-10-06 14:05:49', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n<div class="block-title"><strong><span>Company</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about-latomas-store/">About Us</a></li>\r\n<li><a href="{{store url=""}}contact-us/">Contact Us</a></li>\r\n<li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n<li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\r\n</ul>\r\n</div>', '2014-10-06 14:05:49', '2014-10-27 07:43:14', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-10-06 14:05:49', '2014-10-06 14:05:49', 1),
(4, 'New block', 'new_block', '<p><img src="{{media url="wysiwyg/48366.2.detail.jpg"}}" alt="" /></p>\r\n<p><img src="{{media url="wysiwyg/50468.0.browse-s.jpg"}}" alt="" /></p>\r\n<p><img src="{{media url="wysiwyg/49355.0.zoom.jpg"}}" alt="" /></p>\r\n<p><img src="{{media url="wysiwyg/azz19139_black_default_xl_1.jpg"}}" alt="" /></p>', '2014-10-20 10:47:53', '2014-11-04 20:16:23', 1),
(7, 'About', 'about', '<p>aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa</p>', '2014-10-23 14:53:07', '2014-10-23 14:53:07', 1),
(8, 'Google maps', 'google-maps', '<div id="google-map"><iframe src="https://maps.google.com/maps/ms?msa=0&amp;msid=201931294760135328451.0005027b0cb2660ec9f1d&amp;ie=UTF8&amp;t=m&amp;start=0&amp;geocode=&amp;ll=21.036562,105.815903&amp;spn=0,0&amp;output=embed" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" width="90%" height="350"></iframe><br />\r\n<div style="color: #fff; text-align: left;">Xem <a style="color: yellow;" href="https://maps.google.com/maps/ms?msa=0&amp;msid=201931294760135328451.0005027b0cb2660ec9f1d&amp;ie=UTF8&amp;t=m&amp;start=0&amp;geocode=&amp;ll=21.036562,105.815903&amp;spn=0,0&amp;source=embed" target="_blank">Địa điểm </a> ở bản đồ lớn hơn</div>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div class="contact-title"><span style="color: #ffff00;">CONTACT US</span></div>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;The place where you have a last ditch attempt at getting potential clients, customers and fans to get in touch or, in my case, convince them otherwise (I get a lot of emails). So we&rsquo;ve had a look at the best About Us pages and now I want to do the same for the Contact Us page. What are the best practices? What works and what doesn&rsquo;t? Is there anything you can do to increase your chances of success? Let&rsquo;s take a look at what I think are 10 of the best Contact Us pages on the internet.</p>', '2014-10-23 19:27:11', '2014-10-27 07:33:32', 1);
