INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2014-10-06 14:05:48', '2014-10-06 14:05:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Clothes | Home page', 'one_column', NULL, NULL, 'home', NULL, '<h1></h1>', '2014-10-06 14:05:48', '2014-10-27 08:51:43', 1, 0, '<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        \r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'one_column', NULL, NULL, 'about-latomas-store', NULL, '<div class="page-title">\r\n<h1>About Latomas Store</h1>\r\n</div>\r\n<div class="col3-set">\r\n<div class="col-1">\r\n<p>Based in Budapest, Latomas opened its doors in 1998 as one of the first independent fashion boutiques to open following the fall of Communism a few years prior.</p>\r\n<p>Since its inception by half-French, half-Hungarian founder, Julie Szontagh, Latomas has aimed to provide limited series, pret-&aacute;-porter items that mirror current trends but remain unique, exclusive, and affordable.</p>\r\n<p>The shop has gone through several changes over the past decade and a half and now boasts two locations for women and one for men, along with an online shop.</p>\r\n<p>As always, you can expect Latomas to refresh their inventory for all locations every few weeks, so if you don''t find your size or what you''re looking for be sure to check back often. And don''t forget to Like us on&nbsp;<a class="fb_link" href="https://www.facebook.com/latomas" target="_blank"><span style="text-decoration: underline;"><strong>Facebook</strong></span></a>&nbsp;and subscribe to our newsletter to make sure you never miss out.</p>\r\n<p><img src="{{media url="wysiwyg/mg.jpg"}}" alt="" /></p>\r\n</div>\r\n</div>', '2014-10-06 14:05:49', '2014-10-27 07:42:34', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
